import React from 'react'
import moment from "moment";

export const SupportedHeader = (props)=> {
    return (
        <div className="my-3">
        <h1 className="text-center main-header">Tech@SG</h1>
          <div className="text-center">Supported Technologies as of {moment(props.lastUpdate.tech).format("DD MMMM YYYY")}</div>
          <div className="mt-3 w-75 mx-auto text-center">{props.stackItems}</div>
        </div>
    )
}
